const MISAResource = {
    MISANotify: {
        Error: "Lỗi!",
        Success: "Thành công!",
        Warning:{
            Title:"Cảnh báo!"
        },
        Info:{
            Title: "Thông tin!"
        }
    }
}
export default MISAResource
